import React from 'react';
import {
    Switch,
    Route
} from "react-router-dom";

import MainPage from './MainPage';
import Gallery from './Gallery';
import About from './About';
// import Comments from './Comments';
import ForChaerin from './ForChaerin';
import Spring from './Spring';
import Summer from './Summer';
import Winter from './Winter';
import Point from './Point';

function Main() {

    return (
        <>
            <Switch >
                <Route exact path="/">
                    <MainPage />
                </Route>
                <Route path="/spring">
                    <Spring />
                </Route>
                <Route path="/summer">
                    <Summer />
                </Route>
                <Route path="/autumn">
                    <Gallery />
                </Route>
                <Route path="/winter">
                    <Winter />
                </Route>
                <Route path="/point">
                    <Point />
                </Route>
                <Route path="/About">
                    <About />
                </Route>
                <Route path="/Contact">
                    <About text='about'/>
                </Route>
                <Route path="/Shop">
                    <About text='shop'/>
                </Route>
                <Route path='/forchaerin'>
                    <ForChaerin />
                </Route>
                {/* <Route path="/comments">
                    <Comments />
                </Route> */}
            </Switch>
        </>
    )
}

export default Main

/*
            {id: 1, title: 'About'},
        {id: 2, title: 'Gallery'},
        {id: 3, title: 'Shop'},
        {id: 4, title: 'Contact'}
*/
